import { IWriteOff } from 'app/payment/annual-write-off/model/write-off-record.model';
import { IAnnualWriteOff } from 'app/payment/annual-write-off/model/annual-write-off.model';

export interface IViewAnnualWriteOffData {
  annualWriteoff?: IAnnualWriteOff,
  successfulWriteOffs?: IWriteOff[],
  failedWriteOffs?: IWriteOff[],
  pendingWriteOffs?: IWriteOff[],
}


export class ViewAnnualWriteOffData implements IViewAnnualWriteOffData {
  constructor(
    public annualWriteoff?: IAnnualWriteOff,
    public successfulWriteOffs?: IWriteOff[],
    public failedWriteOffs?: IWriteOff[],
    public pendingWriteOffs?: IWriteOff[],
  ) {
  }
}
